import * as React from 'react';
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import CssBaseline from '@mui/material/CssBaseline';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import List from '@mui/material/List';
import Typography from '@mui/material/Typography';
import Divider from '@mui/material/Divider';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import IconButton from "@mui/material/IconButton";
import AddShoppingCartIcon from "@mui/icons-material/AddShoppingCart";
import MenuIcon from '@mui/icons-material/Menu';
import {useEffect, useState} from "react";
import {useLocation, useNavigate} from "react-router-dom";
import SellIcon from '@mui/icons-material/Sell';
import {getCategories} from "../api/CategoryService";
import {getCartProducts} from "../api/CartService";
import {Products} from "./Products";
import {getProducts} from "../api/ProductsService";
import {Checkout} from "./Checkout";



export const CategoryList = () => {

    const navigate = useNavigate()
    const location = useLocation()
    const [categories, setCategories] = useState([])
    const [selectedCategoryId, setSelectedCategoryId] = useState(0)
    const [products, setProducts] = useState([]);
    const [cartProducts, setCartProducts] = useState([]);


    useEffect(() => {
        getCategories().then((res) =>
        {
            setCategories(res)
        });
    },[])

    useEffect(() => {
        getProducts(selectedCategoryId).then((res) => {
            setProducts(res)
        })
    },[selectedCategoryId]);

    useEffect(() => {
        const cartId = localStorage.getItem('cartId');
        if(cartId){
            getCartProducts(cartId).then((res) => {
                setCartProducts(res)
            })
        }
    },[localStorage.getItem('cartId')])


    return (
        <Box sx={{ display: 'flex' }}>
            <CssBaseline />
            <AppBar
                position="fixed"
                sx={{ width: `calc(100% - ${drawerWidth}px)`, ml: `${drawerWidth}px`, background: '#4d72eb' }}
            >
                <Toolbar>
                    <IconButton
                        color="inherit"
                        aria-label="menu"
                        sx={{ mr: 2, display: { md: 'none' } }}
                        onClick={() => setOpen(true)}
                    >
                        <MenuIcon />
                    </IconButton>
                    <Typography
                        variant="h6"
                        noWrap
                        component="div"
                        sx={{ display: { xs: 'none', sm: 'block' } }}
                    >
                        E-Commerce
                    </Typography>
                    <Box sx={{ flexGrow: 1 }} />
                    <Box sx={{ display: { xs: 'none', md: 'flex' } }}>
                        <IconButton
                            onClick={() => navigate('/checkout')}
                            size="large"
                            color="inherit"
                        >
                            <AddShoppingCartIcon />
                        </IconButton>
                    </Box>
                </Toolbar>
            </AppBar>
            <Drawer
                variant="temporary"
                anchor="left"
                open={open}
                onClose={() => setOpen(false)}
                ModalProps={{ keepMounted: true }}
                sx={{
                    display: { xs: 'block', md: 'none' },
                    '& .MuiDrawer-paper': {
                        boxSizing: 'border-box',
                        width: drawerWidth,
                    },
                }}
            >
                <List
                    sx={{ width: '100%', maxWidth: 360, bgcolor: 'background.paper' }}
                    component="nav"
                    aria-labelledby="nested-list-subheader"
                    subheader={
                        <ListSubheader component="div" id="nested-list-subheader">
                            Kategoriler
                        </ListSubheader>
                    }
                >
                    {categories.map((category) => (
                        <ListItem
                            button
                            key={category.categoryId}
                            selected={selectedCategoryId === category.categoryId}
                            onClick={() => {
                                setSelectedCategoryId(category.categoryId);
                                setOpen(false);
                            }}
                        >
                            <ListItemIcon>
                                <SellIcon />
                            </ListItemIcon>
                            <ListItemText primary={category.categoryName} />
                        </ListItem>
                    ))}
                </List>
            </Drawer>

            <Box
                component="main"
                sx={{ flexGrow: 1, bgcolor: 'background.default', p: 3 }}
            >
                <Toolbar />
                {
                    location.pathname === '/' ? <Products products={products}/> : <Checkout cartProducts={cartProducts}/>
                }
            </Box>
        </Box>
    );
}
